import React from 'react'
import {Link} from 'react-router-dom';

const NavBar = () => {
  return (
    <>
    <Link> About </Link>
      <a href="/"> Aboutpage </a>
      <a href="/contact"> Conactpage </a>
    </>
  )
}

export default NavBar
